import React, { Component } from "react";

const userLatNavBar = () => {
  return (
    <span class="border">
      <ul class="nav flex-column">
        <li> Julio </li>
        <li> Pedra </li>
        <li> Conceição </li>
      </ul>
    </span>
  );
};

export default userLatNavBar;
